// SPDX-License-Identifier: MIT

pragma solidity ^0.8.9;

contract Project {
    uint256 public count;

    enum ProjectStatus {
        PENDING,
        STARTED,
        COMPLETED,
        CANCELLED,
        PAUSED
    }

    struct ProjectInfo {
        uint256 id;
        string name;
        string description;
        string location;
        uint256 estimatedBudget;
        uint256 fundedMoney;
        uint256 estimatedDuration;
        uint256 createdAt;
        string companyId;
        string accountNumber;
        ProjectStatus status;
        // string financialOfficerUsername;
        // string projectManagerUsernmae;
        // string budgetAndProcurementManagerUsername;
        // string externalAuditorUsername;
    }

    event AddedProject(
        uint256 id,
        string indexed name,
        string description,
        string indexed location,
        uint256 estimatedBudget,
        uint256 estimatedDuration,
        uint256 fundedMoney,
        uint256 createdAt,
        string indexed companyId,
        string accountNumber,
        string status
    );

    event DeletedProject(
        uint256 indexed id,
        string name,
        string description,
        string location,
        uint256 estimatedBudget,
        uint256 estimatedDuration,
        uint256 fundedMoney,
        uint256 createdAt,
        string indexed companyId,
        string accountNumber,
        string status
    );

    mapping(uint256 => ProjectInfo) public projects;

    // add onlyTechnicalAdmin modifier to it
    function addProject(
            string memory name,
            string memory description,
            string memory location,
            string memory estimatedBudget,
            uint256 estimatedDuration,
            uint256 fundedMoney,
            uint256 createdAt,
            string memory companyId,
            string memory accountNumber,
            string memory status
    ) external {
        // projects[++count] = project;

        // emit AddedProject(
        //     project.id,
        //     project.name,
        //     project.description,
        //     project.location,
        //     project.estimatedBudget,
        //     project.estimatedDuration,
        //     project.fundedMoney,
        //     project.createdAt,
        //     project.companyId,
        //     project.accountNumber,
        //     project.status,
        // );
    }

    function deleteProject(uint256 _id) external {
        delete projects[_id];
        //TODO emit deleted project event after arranging the project struct
    }
}
